import React from 'react';
import {Route, Routes} from 'react-router-dom'
import Shop from '../pages/Shop';
import { getAuth, getPublic } from '../routes';

const AppRouter =() => {
    const authRoutes = getAuth();
    const publicRoutes = getPublic();

    const isAuth = false;
    return (
    <Routes>
        {isAuth && authRoutes.map((i) =>
            <Route key={i.path} path={i.path} element={i.Component} exact/>
        )}
        {publicRoutes.map((i) =>
            <Route path={i.path} element={i.Component} exact/>
        )}
    </Routes>
    );
};

export default AppRouter;
